import React from "react";
import OrderShedule from "./OrderShedule/OrderShedule";
import './MainApp.css'

let MainApp = (props) => {

    let aaaa = [{
        froms: 'Moscow',
        to: 'Sarov',
        date: 'Wed Jul 29 2020 16:52:31 GMT+0300 (Москва, стандартное время)',
        price: '123.3'
    }]

    return (
        <div className="MainContainer">
            <h3>Мои заказы</h3>
            <div style={{display: "flex", color: "white", fontSize: 14, fontWeight: "Regular"}}>
                Место отправления Место прибытия Время заказа Стоимость
            </div>

            <div>
                <OrderShedule aaaa={aaaa} />
            </div>
        </div>
    )
}

export default MainApp;
